import React from 'react';


import {Tooltip,OverlayTrigger,Form,ButtonGroup,ButtonToolbar,CardColumns,CardGroup,Card,Button,Container,Nav,Navbar,NavDropdown } from 'react-bootstrap';
import {BrowserRouter as Router,Switch,Route,Link} from "react-router-dom";


import Connection from "../Connection";

// Partnerships
import PartnershipHunt1 from "./PartnershipHunt1";
import PartnershipNav from './PartnershipNav';
import PartnerHome from "./PartnerHome";

// Partnerships

// THAAS HUNT Example

// "/PartnershipExample1"
// "/PartnershipExampleHome"
// "/PartnershipLevel1"
// "/PartnershipLevel1More"
// "/PartnershipLevel2"
// "/PartnershipLevel2More"
// "/PartnershipLevel3"
// "/PartnershipLevel4"

import PartnershipLevel1 from "./MiniGamesSelector/Game1";
import PartnershipLevel1More from "./MiniGamesSelector/Game1MoreGame1";


import PartnershipLevel2 from "./MiniGamesSelector/Game2";
import PartnershipLevel2More from "./MiniGamesSelector/Game2MoreGame1";

import PartnershipLevel3 from "./MiniGamesSelector/Game3";
import PartnershipLevel4 from "./MiniGamesSelector/Game4";

const PartnerTemplates = (props) => {

  const commaNumber = require('comma-number')





  return(

    <div>

    // Example Partnership Starts


                  <Route path={props.partnership_treasure_hunt_page} >
                  <PartnershipNav {...props} onClick={() => Connection()}/>
                    <PartnershipHunt1{...props}/>
                  </Route>

                  <Route path={props.partnership_home} >
                  <PartnershipNav {...props}  onClick={() => Connection()}/>
                    <PartnerHome  {...props}/>
                  </Route>

                  <Route path={props.partnership_1}>
                  <PartnershipNav {...props} onClick={() => Connection()}/>
                  <PartnershipLevel1  {...props}/>
                  </Route>

                  <Route path={props.partnership_1_more}>
                  <PartnershipNav {...props} onClick={() => Connection()}/>
                  <PartnershipLevel1More  {...props}/>
                  </Route>

                  <Route path={props.partnership_2}>
                  <PartnershipNav {...props} onClick={() => Connection()}/>
                  <PartnershipLevel2  {...props}/>
                  </Route>

                  <Route path={props.partnership_2_more}>
                  <PartnershipNav {...props} onClick={() => Connection()}/>
                  <PartnershipLevel2More  {...props}/>
                  </Route>

                  <Route path={props.partnership_3}>
                  <PartnershipNav {...props} onClick={() => Connection()}/>
                  <PartnershipLevel3  {...props}/>
                  </Route>

                  <Route path={props.partnership_4}>
                  <PartnershipNav {...props} onClick={() => Connection()}/>
                  <PartnershipLevel4  {...props}/>
                  </Route>

    // Partnership End


    </div>





  );


};

export default PartnerTemplates;
